import { useState, useEffect } from "react";
import AddIcon from "@mui/icons-material/Add";
import styled from "styled-components";
import { useDispatch } from "react-redux";
import { addProductapi, editProductapi } from "../redux/apiCalls/productsApis";



function Addserviceorder() {

  const [data, setdata] = useState({
    lname: "",
    service: "",
    startdate: "",
    enddate: "",
    amount: "",
  });

  const handleInput = (e) => {
    // console.log(e);
    
    // console.log(pd.length);
    // console.log(editvalu);

    const name = e.target.name;
    const value = e.target.value;

   

    setdata({
      ...data,
      [name]: value,
    });

    
    console.log(data);
  };

 
  
  

  

   
  return (
    <div className="maincontainer">
      <h1>Add Ordder</h1>
      <div className="inputfield">
        <label>Enter Library Name </label>
        <input
          name="lname"
          onChange={handleInput}
          value={data.lname}
          required
          type="text"
        />
      </div>
      <div className="inputfield">
        <label>Enter Service name </label>
        <input
          name="lname"
          onChange={handleInput}
          value={data.lname}
          required
          type="text"
        />
      </div>
      <div className="inputfield">
        <label>Start Date of service </label>
        <input
          name="lname"
          onChange={handleInput}
          value={data.lname}
          required
          type="date"
        />
      </div>
      <div className="inputfield">
        <label>End Date of service </label>
        <input
          name="lname"
          onChange={handleInput}
          value={data.lname}
          required
          type="date"
        />
      </div>
      <div className="inputfield">
        <label>Amount </label>
        <input required type="number" />
      </div>
      <div className="inputfield">
        <button
          type="button"
          // onClick={handleSubmit}
          className="btn "
        >
          Add <AddIcon />
        </button>
      </div>
    </div>
  );
}

export default Addserviceorder;
